import logo from "./logo.svg";
import "./App.css";

// 【props：向组件传递数据】
const hello = (props) => {
  const currentDate = new Date();
  const a = 10;
  const b = 23;
  return (
    <div>
      <p>
        Hello world, {props.attr}, {props.feature}
      </p>
      <p> heeeello world, it is now {currentDate.toDateString()}</p>
      <p>
        {props.attr + props.feature} {a} plus {b} is {a + b}
      </p>
    </div>
  );
};
function App() {
  console.log("loopring goes to the moon!");
  const name = "peter";
  const age = 12;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Hello attr="wagmi" feature="hdy.kls" />
        <Hello attr={name} feature={age} />
      </header>
    </div>
  );
}

export default App;
